%[text] # Specification of move data
%[text] Explain the move data implemented using Gauss code in VirtualLink class.
%[text] 
%[text] #### Reference:
%[text] Muramatsu, K., Suzuki, S., & Taguchi, K. (2024). On Matveev-Piergallini moves for branched spines. *arXiv preprint* arXiv:2405.18743.
%[text] URL: [https://arxiv.org/abs/2405.18743](https://arxiv.org/abs/2405.18743)
%[text] 
%[text] ## MP moves
%[text] 16 types of MP moves are classified into types \[A,B,C,D\] and \[1,2,3,4\].
%[text] 
%[text] 
%[text] ![](text:image:2538)
%[text] ![](text:image:9005)
%[text] `gc` : Gauss Code of strand {\[array of signed vertices\]},   `ori` : orientations, signatures of crossings
%[text] `T_MP_L` : left hand side of MP move (2 vertices),   `T_MP_R` : right hand side of MP move (3 vertices)
%[text] #### LHS
load("MPmoveData.mat")
disp(T_MP_L(:,["param","gc","ori"])) %[output:12684d3a]
%[text] #### RHS
disp(T_MP_R(:,["param","gc","ori"])) %[output:43d7c0dd]
